def look_temperature(uid,time):
    id = session.get('id')
    user1 = Admin_people.query.filter(Admin_people.id == id).first()
    user = User.query.filter(User.id == uid).first()
    time = time
    now = datetime.now()
    to_day = now.day
    to_month = now.month
    to_year = now.year
    oneday = timedelta(days=1)
    today = datetime(to_year, to_month, to_day)
    yesterday = today - timedelta(days=1)
    tomorrow = today + timedelta(days=1)
    find_time1 = datetime.strptime(time, "%Y-%m-%d %H:%M:%S")
    find_year=find_time1.year
    find_month = find_time1.month
    find_day = find_time1.day
    find_time = datetime(find_year, find_month, find_day)
    find_tomorrow = find_time + timedelta(days=1)
    user_logs = User_log.query.filter(User_log.user_id == uid, User_log.create_time.between(find_time, find_tomorrow),
                                      User_log.if_sure == True).order_by(User_log.create_time.desc()).all()
    findday_logs = User_log.query.filter(User_log.user_id == uid,
                                         User_log.create_time.between(find_time, find_tomorrow)).order_by(
        User_log.create_time.desc()).all()
    findday_temperature = []
    total_temperature = 0
    for user_log in user_logs:
        temperature = user_log.temperature
        findday_temperature.append(temperature)
    for temperaturei in findday_temperature:
        total_temperature = total_temperature + float(temperaturei)
    if len(findday_temperature) == 0:
        average = 36.5
        max_temperature = 36.5
    else:
        average = total_temperature / len(findday_temperature)  # 昨天今天的平均体温
        average = round(average, 2)
        max_temperature = max(findday_temperature)
    total = len(findday_logs)  # 查找的那天总共有多少条记录
    abnormal = len(
        User_log.query.filter(User_log.user_id == uid, User_log.status == '异常',
                              User_log.create_time.between(find_time, find_tomorrow)).all())#查找的那天有多少异常数据


    begin_day = datetime(to_year, to_month, to_day) - oneday * 14
    twoweeks_temperature = []
    for i in range(14):
        begin = begin_day + timedelta(days=i)
        end = begin + timedelta(days=1)
        logs = User_log.query.filter(User_log.create_time.between(begin, end), User_log.user_id == uid,
                                     User_log.if_sure == True).all()
        sum = 0
        if len(logs) == 0:
            oneday_temperature = 0
        else:
            today_temperature = []
            for log in logs:
                today_temperature.append(float(log.temperature))
            for i in today_temperature:
                sum = sum + i
            oneday_temperature = sum / len(today_temperature)
            oneday_temperature = round(oneday_temperature, 2)
        twoweeks_temperature.append(oneday_temperature)



    data = {
        'user_id': user.id, #前端要用到当前的人的id
        'test': 'test',
        'average': average,
        'max_temperature': max_temperature,
        'total': total,
        'abnormal': abnormal,
        'twoweeks_temperature': twoweeks_temperature,
        'user_name': user.name
    }
    logs = [{
        'name':user.user.name,
        'id': user.id,
        'temperature': user.temperature,
        'status': user.status,
        'if_sure': user.if_sure,
        'time': user.create_time,
        'location': user.equipment.location,
        'picture': '这是视频和抓图'
    } for user in findday_logs
    ]

    equipment = user1.equipments[0]
    alarms = User_log.query.filter(User_log.equipment_id == equipment.id, User_log.status == '异常'
                                   ,User_log.create_time.between(begin_day, tomorrow)).order_by(
        User_log.create_time.desc()).all()
    print(alarms)
    count = len(alarms)
    time1 = time.split(' ')[0]
    twoweek = []
    for i in range(14):
        day = today - timedelta(days=i)
        twoweek.append(str(day).split(' ')[0])
    return render_template('louguan/look_temperature.html', date=data,
                           alarms=alarms, count=count, user=user1, logs=logs,time=time1,twoweeks=twoweek)
